import React , { Component } from 'react';


class Product extends Component{
	state={

	}
	render(){
		return(
			<div className='container bg-default'>
				<h5>{this.props.ProductName}</h5>
				<span>Likes:{this.props.Likes}</span>
				<span>Coments:{this.props.Coments}</span>
				<span>Dislikes:{this.props.Dislikes}</span>
			</div>
		);
	}
}

export default Product;
